// src/App.js
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Home from './components/Home';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import Spreadsheet from './components/Spreadsheet';

const CLIENT_ID = '610747845268-slmna79ev773a3bp5uhem52u21n645o2.apps.googleusercontent.com'; // Replace with your Google Client ID

// A basic authentication check function
const isAuthenticated = () => {
  return localStorage.getItem('isAuthenticated') === 'true';
};

// A PrivateRoute component to protect routes that require authentication
const PrivateRoute = ({ element }) => {
  return isAuthenticated() ? element : <Navigate to="/login" />;
};

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/dashboard" element={<PrivateRoute element={<Dashboard />} />} />
        <Route path="/spreadsheet" element={<PrivateRoute element={<Spreadsheet />} />} />
      </Routes>
    </div>
  );
}

export default App;
